INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_signInUrl`, `field_contactText`, `field_requestADemoUrl`, `field_twitter`, `field_linkedin`, `field_facebook`, `field_teamName`, `field_teamPosition`, `field_youtube`, `field_description`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-09-29 20:22:06', '2015-09-29 20:22:06', '0ce6a8d5-15f4-4432-b081-f1ba1a11c360');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_signInUrl`, `field_contactText`, `field_requestADemoUrl`, `field_twitter`, `field_linkedin`, `field_facebook`, `field_teamName`, `field_teamPosition`, `field_youtube`, `field_description`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Welcome to Poet.dev!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Poet.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-09-29 20:22:09', '2015-10-12 18:26:44', '45ee9cf5-cb5d-4d98-b558-6cb58fea7944');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_signInUrl`, `field_contactText`, `field_requestADemoUrl`, `field_twitter`, `field_linkedin`, `field_facebook`, `field_teamName`, `field_teamPosition`, `field_youtube`, `field_description`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '3', 'en_us', '​Some post about a topic', '<p>Craft is the CMS that’s powering Poet.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A company is only as good as the individuals working within it. At POET, we focus on putting together an elite team that can deliver outstanding results. We are the designers, developers and business professionals working day and night to change the retail experience.', '2015-09-29 20:22:09', '2015-10-13 13:53:49', '6cf8e93b-fbc9-4522-9bbc-08151b410027');
